import React from "react";
import styles from "./ListHeader.module.css";

export const ListHeader = () => {
  return (
    <td>
      <th>Full name</th>
      <th>Birthday</th>
      <th>Gender</th>
      <th>Department</th>
      <th>Salary</th>
    </td>
  );
};
